import './styles/MenuBar.css'
const MenuBar = () => {
  return (
    <header>
      <img src="./logo.svg" alt='my-picture' />
      <ul className="menu-bar">
        <li>ABOUT</li>
        <li>EXPERIENCE</li>
        <li>EDUCATION</li>
        <li>SKILL</li>
        <li>INTERESTS</li>
      </ul>
    </header>
  );
}

export default MenuBar;
